?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: Times New Roman;">Maurice Lacroix – это один из немногих независимых производителей, который производит высококачественные и оригинальные часы. Эта компания вошла на мировой часовой рынок достаточно недавно, в 1975 году. Но, за время своего функционирования, компания сумела добиться к себе благосклонного расположения часовой общественности. На данный момент, продукция компании продается в, более чем, 50 странах мира. И, это, разумеется, не просто так. Все механизмы и детали, сотрудники компании собирают вручную, сохраняя при этом традиционное швейцарское качество и сочетая многовековые традиции вместе с современными тенденциями. Кроме того, компания самостоятельно производит родиевое напыление всех механизмов часов. Помимо этого, на каждом этапе производства, будь то первоначальная разработка эскизов, или собирание самих часов, проводится тщательная проверка и тестирование на предмет соответствия общепринятым стандартам качества. Компания Maurice Lacroix – это великолепное сочетание высокого качества и многофункциональности вместе с доступной ценовой политикой.</span></span></p>
 
